package analyzer

import (
	"encoding/hex"
	"fmt"
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestItem(t *testing.T) {
	assert := assert.New(t)

	packet := &EQPacket{}
	packets := []string{
		"",
	}
	var err error
	for _, p := range packets {
		packet.Data, err = hex.DecodeString(p)
		if !assert.NoError(err) {
			t.Fatal(err)
		}
		zone := ZoneScan(packet)
		fmt.Println(zone)
		t.Log(zone)
	}
	t.Fatal("done")
}
